import React, { Component } from 'react';

class CardsPreview extends Component {
    state = {
        width: this.props.width,
        height: this.props.height,
        borderRadius: this.state.borderRadius,

    }
    // state = {
    //     Width: this.props.Width,
    //     height: this.props.height,
    //     borderRadius: this.props.borderRadius,
    //     title1: this.props.title1,
    //     title2: this.props.title2,
    //     price: this.state.price,
    //     cardNo: this.state.cardNo,
    //     icon: this.props.icon,
    //     date: this.state.date,
    //     className: this.props.className,
    //     textColor: this.state.textColor,
    //     progress: this.props.progress
    // }
    render() {
        return (
            <div className="col-md-4">
                <div style={{width: this.state.width, height: this.state.height, borderRadius: this.state.borderRadius, background: this.state.icon}}>
                    <div className="top">
                        <div className="balance">
                            <span>{this.state.title2}</span>
                            <h3>{this.state.price}</h3>
                        </div>
                        <div className="card-icon">{this.state.icon}</div>
                    </div>
                    <div className="bottom">
                        <div className="card-info">
                            <span>{this.state.title2}</span>
                            <h4>{this.state.cardNo}</h4>
                        </div>
                        <div className="date">
                            <span>{this.state.date}</span>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default CardsPreview;
